script: |
  super -f text -I q10052.spq | sort > q10052.out

inputs:
  - name: q10052.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT + col0 / + + 79 + - col1 + col0 * + col1 BETWEEN col0 + CAST ( col2 AS REAL ) * + + col1 / col1 AND ( + col2 );
  - name: tab1

outputs:
  - name: q10052.out
    data: |
      51	14	96
      85	5	59
      91	47	68
